class TestGooglon(unittest.TestCase):

    def setUp(self):
        from googlon import Googlon
        self.googlon = Googlon("gfzts", 3, "Bar", "m", 7, True, "Bar", "Bar", "twdcrzpsvhmklnfxqjbg", 502344, 4)
        self.googlon_alfa = Googlon("mcdpj", 5, "Foo", "k", 5, False, "Bar", "Bar", "sklzmwtjdvrfpgqchbxn", 993599, 3)
        self.googlon_beta = Googlon("zqwdc", 5, "Foo", "p", 7, True, "Bar", "Bar", "wlpchbdgqnjxfszktvmr", 613325, 3)
        self.googlon_gama = Googlon("zsphj", 4, "Bar", "t", 7, True, "Foo", "Foo", "dblhqcnvpmkzgrswjxft", 504851, 5)

    def test_isBar(self):
        self.assertEqual(self.googlon.isBar("a"), False)
        self.assertEqual(self.googlon.isBar("c"), True)
        self.assertEqual(self.googlon.isBar("l"), True)
        self.assertEqual(self.googlon.isBar("x"), True)
        self.assertEqual(self.googlon.isBar("3"), False)
        
    def test_isPreposition(self):
        self.assertEqual(self.googlon.isPreposition("xxx"), True)
        self.assertEqual(self.googlon.isPreposition("xxxx"), False)
        self.assertEqual(self.googlon.isPreposition("xxa"), False)
        self.assertEqual(self.googlon.isPreposition("xmx"), False)
        self.assertEqual(self.googlon.isPreposition("30x"), True)
        
    def test_isVerb(self):
        self.assertEqual(self.googlon.isVerb("xxx"), False)
        self.assertEqual(self.googlon.isVerb("xxxxxxx"), True)
        self.assertEqual(self.googlon.isVerb(""), False)
        self.assertEqual(self.googlon.isVerb("asdjadkjh"), True)
        self.assertEqual(self.googlon.isVerb("ajsdhakhdi"), False)
        
    def test_isVerbInFirstPerson(self):
        self.assertEqual(self.googlon.isVerbInFirstPerson("xxxxxxx"), True)
        self.assertEqual(self.googlon.isVerbInFirstPerson("hsdjadkjh"), True)
        self.assertEqual(self.googlon.isVerbInFirstPerson("asdjadkjh"), False)
        
    def test_isPrettyNumber(self):
        self.assertEqual(self.googlon.isPrettyNumber(1), False)
        self.assertEqual(self.googlon.isPrettyNumber(4), False)
        self.assertEqual(self.googlon.isPrettyNumber(502344), True)
        self.assertEqual(self.googlon.isPrettyNumber(502345), False)
        self.assertEqual(self.googlon.isPrettyNumber(50238371), False)
        
    def test_prepositions(self):
        self.assertEqual(len(self.googlon.prepositions(TEXT_A)), 62)
        self.assertEqual(len(self.googlon.prepositions(TEXT_B)), 64)
        
        self.assertEqual(len(self.googlon_alfa.prepositions(TEXT_A_ALFA)), 22)
        self.assertEqual(len(self.googlon_alfa.prepositions(TEXT_B_ALFA)), 25)
        
        self.assertEqual(len(self.googlon_beta.prepositions(TEXT_A_BETA)), 21)
        
        self.assertEqual(len(self.googlon_gama.prepositions(TEXT_A_GAMA)), 56)
        self.assertEqual(len(self.googlon_gama.prepositions(TEXT_B_GAMA)), 62)
        
    def test_verbs(self):
        self.assertEqual(len(self.googlon.verbs(TEXT_A)[0]), 149)
        self.assertEqual(len(self.googlon.verbs(TEXT_A)[1]), 123)
        self.assertEqual(len(self.googlon.verbs(TEXT_B)[0]), 160)
        self.assertEqual(len(self.googlon.verbs(TEXT_B)[1]), 112)
        
        self.assertEqual(len(self.googlon_alfa.verbs(TEXT_A_ALFA)[0]), 198)
        self.assertEqual(len(self.googlon_alfa.verbs(TEXT_A_ALFA)[1]), 145)
        self.assertEqual(len(self.googlon_alfa.verbs(TEXT_B_ALFA)[0]), 230)
#        self.assertEqual(len(self.googlon_alfa.verbs(TEXT_B_ALFA)[1]), 5)
        
        self.assertEqual(len(self.googlon_beta.verbs(TEXT_A_BETA)[0]), 158)
        self.assertEqual(len(self.googlon_beta.verbs(TEXT_A_BETA)[1]), 121)
        
        self.assertEqual(len(self.googlon_gama.verbs(TEXT_A_GAMA)[0]), 52)
        self.assertEqual(len(self.googlon_gama.verbs(TEXT_A_GAMA)[1]), 17)
        self.assertEqual(len(self.googlon_gama.verbs(TEXT_B_GAMA)[0]), 49)
        self.assertEqual(len(self.googlon_gama.verbs(TEXT_B_GAMA)[1]), 11)
        
    def test_vocabulary(self):
        self.assertEqual(self.googlon.vocabulary(TEXT_A), ASSERT_A)
        self.assertEqual(self.googlon.vocabulary(TEXT_B), ASSERT_B)
        
        self.assertEqual(self.googlon_alfa.vocabulary(TEXT_A_ALFA), ASSERT_A_ALFA)
        self.assertEqual(self.googlon_alfa.vocabulary(TEXT_B_ALFA), ASSERT_B_ALFA)
        
        self.assertEqual(self.googlon_beta.vocabulary(TEXT_A_BETA), ASSERT_A_BETA)
        
        self.assertEqual(self.googlon_gama.vocabulary(TEXT_A_GAMA), ASSERT_A_GAMA)
        self.assertEqual(self.googlon_gama.vocabulary(TEXT_B_GAMA), ASSERT_B_GAMA)
        
        
    def test_number(self):
        self.assertEqual(self.googlon.number("skpbrjs"), 503186627)
        self.assertEqual(self.googlon_alfa.number("rjbjblps"), 777182950)
        self.assertEqual(self.googlon_gama.number("tlqkfws"), 946961659)
        
    def test_distinctPrettyNumbers(self):
        self.assertEqual(len(self.googlon.distinctPrettyNumbers(TEXT_A)), 92)
        self.assertEqual(len(self.googlon.distinctPrettyNumbers(TEXT_B)), 107)
        
        self.assertEqual(len(self.googlon_alfa.distinctPrettyNumbers(TEXT_A_ALFA)), 129)
        self.assertEqual(len(self.googlon_alfa.distinctPrettyNumbers(TEXT_B_ALFA)), 133)
        
        self.assertEqual(len(self.googlon_beta.distinctPrettyNumbers(TEXT_A_BETA)), 132)
        
        self.assertEqual(len(self.googlon_gama.distinctPrettyNumbers(TEXT_A_GAMA)), 72)
        self.assertEqual(len(self.googlon_gama.distinctPrettyNumbers(TEXT_B_GAMA)), 77)

if __name__ == '__main__':
    unittest.main()
